import React from 'react'
import {gameStart} from '../Shared/SharedFunction'
import {connect} from 'react-redux'
import '../Style/WinOrLose.css'
function WinOrLose({userChoice,computerChoice}) {

  console.log(gameStart(userChoice, computerChoice))

  const showResult = () =>{
    if(userChoice && computerChoice){
      return <div className="win_lose">
      <h1 >
        { gameStart(userChoice, computerChoice)? "You win": "You Lose"}
        </h1>
      <button>Play Again</button>
    </div>
    }
  }

 return (
   <>
  {showResult()}
  </>
  )
}



const mapStateToProps = (state) => {
  return {
    userChoice: state.userChoice,
    computerChoice: state.computerChoice
  };
};

export default connect(mapStateToProps)(WinOrLose);
